import React from 'react';
import styled from 'styled-components';


const Container=styled.div`
   display:flex;
   justify-content:center;
   align-itemes:center;
   height:100vh;
`
const Button=styled.button`
   max-width:100px;
   padding:16px 32px;
   border-radius:4px;
   border:none;
   background:#141414;
   color:#fff;
   font-size:24px;
   cursor:pointer;
`

function PopupInfo() {
    return (
       <Container>
           <Button>I'm a modal</Button>
       </Container>
    )
}

export default PopupInfo
